/*
https://leetcode.com/problems/number-of-islands/description/
Given an m x n 2D binary grid grid which represents a map of '1's (land) and '0's (water), return the number of islands.

An island is surrounded by water and is formed by connecting adjacent lands horizontally or vertically.
You may assume all four edges of the grid are all surrounded by water.
*/

package main

import "fmt"

type q struct{ r, c int }

var directions = []q{{-1, 0}, {0, -1}, {1, 0}, {0, 1}}

func queueAppend(queue []q, grid [][]byte, row int, col int) []q {
	if row >= 0 && col >= 0 && row < len(grid) && col < len(grid[row]) && grid[row][col] == '1' {
		queue = append(queue, q{row, col})
		grid[row][col] = '2'
	}

	return queue
}

func numIslands(grid [][]byte) int {
	cnt := 0

	var queue []q

	for row := 0; row < len(grid); row++ {
		for col := 0; col < len(grid[row]); col++ {
			if grid[row][col] == '1' {
				cnt++

				queue = queueAppend(queue, grid, row, col)

				for len(queue) > 0 {
					qi := queue[0]
					queue = queue[1:]

					for _, d := range directions {
						queue = queueAppend(queue, grid, qi.r+d.r, qi.c+d.c)
					}

				}
			}
		}
	}

	return cnt
}

